import React from "react";
import {
	BrowserRouter as Router,
	Routes,
	Route,
	Link,
} from "react-router-dom";
import Chat from "./Chat";
import Home from "./Home";
import Music from "./Music";






export default function Navbar() {

		return (
			<Router>
				<div >
					<ul >
						<li>
							<Link to="/">Home</Link>
						</li>
						<li>
							<Link to="/Chat">
								Chat
							</Link>
						</li>
						<li>
							<Link to="/Music">
								Music
							</Link>
						</li>
					</ul>
					<Routes>
						<Route
							exact
							path="/"
							element={<Home />}
						></Route>
						<Route
							exact
							path="/Chat"
							element={<Chat />}
						></Route>
						<Route
							exact
							path="/Music"
							element={<Music />}
						></Route>
					</Routes>
				</div>
			</Router>
		);
	}
